'use strict';

import _ from 'lodash';
import Preconditions from 'preconditions';
import winston from 'winston';
import Promise from 'bluebird';

let $ = Preconditions.singleton();

/**
 * This is the base class for all classes in our architecture.
 *
 *
 * @abstract
 * @class
 */
class CoreObject {

    /**
     *
     * @param {Object} options
     */
    constructor(options) {
        options = options || {};

        let chosenLodashVersion = options.Lodash || _;

        options = chosenLodashVersion.defaults(options, {
            Preconditions: $,
            Lodash: chosenLodashVersion,
            Logger: winston,
            Promise: Promise
        });

        chosenLodashVersion.assign(this, options);
    }

    toDependencyMap() {
        return CoreObject.toDependencyMap(this);
    }

    static toDependencyMap(options) {
        options = options || {
                Lodash: _
            };

        let Lodash = options.Lodash;

        return Lodash.defaults(options, {
            Preconditions: $,
            Logger: winston,
            Promise: Promise
        });
    }
}

export default CoreObject;

'use strict';

import _ from 'lodash';
import Preconditions from 'preconditions';

let Utility = {

    $: Preconditions.singleton()

};

_.merge(Utility, {

    Object: {
        /**
         * Set a value
         *
         * @param {Object} object
         * @param {String} path
         * @param {*} value
         */
        set: function(object, path, value) {
            Utility.$.shouldBeDefined(object);
            Utility.$.shouldBeString(path);

            _.set(object, path, value);

            let sanity = this.get(object, path);

            if (value !== sanity) {
                throw new Error('Does not match');
            }
        },

        /**
         *
         * @param {Object} object
         * @param {String} path
         * @param {String} string
         */
        setString: function(object, path, string) {
            Utility.$.shouldBeDefined(object);
            Utility.$.shouldBeString(path);
            Utility.$.shouldBeString(string);

            return _.set(object, path, string);
        },

        /**
         *
         * @param {Object} object
         * @param {String} path
         * @returns {*}
         */
        get: function(object, path) {
            return _.get(object, path);
        },

        /**
         *
         * @param {Object} object
         * @param {String} path
         * @param {Object} defaultValue
         * @return {*}
         */
        getWithDefaultValue(object, path, defaultValue) {
            var result = this.get(object, path);

            if (!result) {
                this.set(object, path, defaultValue);

                result = defaultValue;
            }

            return result;
        }
    }
});

export default Utility;

