'use strict';

import Utility from '../Utility';
import AbstractObject from '../CoreObject';

// winston : https://strongloop.com/strongblog/compare-node-js-logging-winston-bunyan/

class AbstractBuilder extends AbstractObject {

    constructor(options) {
        super(options);

        this.Lodash.defaults(this, {
            payload: {

            }
        });
    }

    /**
     *
     * @param path
     * @return {*}
     * @protected
     */
    get(path) {
        if (this.Lodash.isUndefined(path)) {
            return this.payload;
        } else {
            return Utility.Object.get(this.payload, path);
        }
    }

    /**
     *
     * @param {String} path
     * @param {*} value
     * @return {AbstractBuilder}
     * @protected
     */
    set(path, value) {
        Utility.Object.set(this.payload, path, value);

        return this;
    }

    /**
     *
     * @param {String} path
     * @param {String} string
     * @protected
     */
    setString(path, string) {
        this.Preconditions.shouldBeString(path, 'path');
        this.Preconditions.shouldBeString(string, 'string');

        return this.set(path, string);
    }

    /**
     * @public
     * @param object
     * @return {AbstractBuilder}
     */
    mergeIntoPayload(object) {
        this.Preconditions.shouldBeDefined(object, 'Cannot merge null');
        this.Preconditions.shouldBeObject(object, 'Should be object');

        this.Lodash.assign(this.payload, object);

        return this;
    }

    /**
     *
     * @param {String} path
     * @param {*} defaultValue
     * @return {*}
     * @public
     */
    getWithDefaultValue(path, defaultValue) {
        return Utility.Object.getWithDefaultValue(this.payload, path, defaultValue);
    }

}

export default AbstractBuilder;

'use strict';

import CoreObject from '../CoreObject';
import NotificationBuilder from '../slack/NotificationBuilder';

/**
 *
 * This class is intended to be instantiated early and (generally) once in your app.
 */
class AbstractNotificationTemplate extends CoreObject {

    constructor(options) {
        super(options);

        this.Lodash.defaults(this, {
            name: 'NotificationTemplate'
        });

        this.Preconditions.shouldBeString(this.name, 'You must define a name for this template');
    }

    /**
     * @public
     * @param {NotificationBuilder} builder
     * @param {*|undefined} data
     * @returns {Promise}
     */
    render(builder, data) {
        // Apply the template. Might be a promise though.
        var result = this.applyTemplate(builder, data);

        result = result || builder;

        return NotificationBuilder.innerCast(
            result,
            this.toDependencyMap());
    }

    /**
     *
     * @protected
     * @param {NotificationBuilder} builder
     * @param {Object} data
     * @return {Promise|NotificationBuilder|Object}
     */
    applyTemplate(builder, data) {
        this.Logger.silly('Builder', builder);
        this.Logger.silly('Data', data);

        throw new Error('This method must be overridden by a subclass');
    }

}

export default AbstractNotificationTemplate;

