class AttachmentBuilder extends AbstractBuilder {

    constructor(parent) {
        super({
            parent: parent
        });

        this.parent
            .attachments()
            .push(this.payload);

        this.set('mrkdwn_in', ['pretext', 'text', 'fields']);
        this.set('color', 'good');
