'use strict';

import Promise from "bluebird";
import Preconditions from "preconditions";
import request from "request-promise";
import CoreObject from "../CoreObject";
import AbstractBuilder from "../slack/AbstractBuilder";
import AttachmentBuilder from "../slack/AttachmentBuilder";

class NotificationBuilder extends AbstractBuilder {

    constructor(options) {
        super(options);

        // Allow the URL to be defined later.
        //this.Preconditions.shouldBeString(this.url, 'NotificationBuilder.constructor(): url must be a string');
    }

    /**
     *
     * @param {String} value
     * @returns {NotificationBuilder}
     */
    channel(value) {
        return this.setString('channel', value);
    }

    /**
     *
     *
     * @param text
     * @returns {NotificationBuilder}
     */
    text(text) {
        return this.setString('text', text);
    }

    /**
     *
     * @param icon
     * @returns {icon}
     */
    icon(icon) {
        return this.setString('icon_emoji', icon);
    }

    username(username) {
        return this.setString('username', username);
    }

    attachments() {
        return this.getWithDefaultValue('attachments', []);
    }

    attachment() {
        return new AttachmentBuilder(this);
    }

    toPayload() {
        return this.payload;
    }

    toJson() {
        return JSON.stringify(this.toPayload());
    }

    /**
     *
     * @return {Promise}
     */
    execute() {
        let scope = this;

        let url = this.url;
        let payload = this.toPayload();

        scope.Preconditions.shouldBeString(scope.url, 'NotificationBuilder.execute(): url must be a string');

        return Promise.resolve()
            .then(() => {
                //
                // https://www.npmjs.com/package/request-promise
                //
                // var options = {
                //    method: 'POST',
                //    uri: 'http://posttestserver.com/post.php',
                //    body: {
                //        some: 'payload'
                //    },
                //    json: true // Automatically stringifies the body to JSON
                // };


                let requestOptions = {
                    uri: url,
                    method: 'POST',
                    body: payload,
                    json: true
                };

                scope.Logger.debug(`[SLACK:${scope.name}] webhook `, requestOptions);

                return Promise.resolve(request(requestOptions))
                    .then(function(value) {
                        scope.Logger.debug(`[SLACK:${scope.name}] webhook succeeded.`, arguments);

                        return value;
                    })
                    .catch(function(err) {
                        scope.Logger.warn(`[SLACK:${scope.name}] webhook failed.`, arguments);

                        throw err;
                    });
            });
    }

    /**
     * Do not insert a Promise into this method.
     *
     * @param {Object|NotificationBuilder} object
     * @param {Object|undefined} deps
     * @param {Preconditions|undefined} deps.Preconditions
     * @return {Promise<NotificationBuilder>}
     */
    static innerCast(object, deps) {
        deps = CoreObject.toDependencyMap(deps);

        let Preconditions = deps.Preconditions;

        Preconditions.shouldBeDefined(object);

        return Promise.resolve(object)
            .then(function(result) {
                Preconditions.shouldBeDefined(object, 'Casted object must be defined.');
                Preconditions.shouldNotBeArray(object, 'Casted object must NOT be an array.');
                Preconditions.shouldBeObject(object, 'Casted object must be an object.');

                if (result instanceof NotificationBuilder) {
                    return result;
                }

                return new NotificationBuilder(object);
            });
    }
}

export default NotificationBuilder;

'use strict';

import NotificationTemplate from './NotificationTemplate';
import NotificationBuilder from './NotificationBuilder';
import AbstractObject from '../CoreObject';

class NotificationService extends AbstractObject {

    /**
     *
     * @param {Object} options
     */
    constructor(options) {
        super(options);

        if (!this.templates) {
            this.templates = {};
        }

        if (!this.mappings) {
            this.mappings = {};
        }

        this.register('DEFAULT_TYPE', new NotificationTemplate({
            name: 'DEFAULT_TEMPLATE'
        }));

        this.payload = {};
    }

    mergeIntoPayload(payload) {
        this.Preconditions.shouldBeObject(payload, 'Payload must be object');
        this.Lodash.assign(this.payload, payload);
    }

    /**
     *
     * @param {String} notificationType
     * @param {NotificationTemplate} notificationTemplate
     * @return {NotificationService}
     */
    register(notificationType, notificationTemplate) {
        this.Preconditions.shouldBeString(notificationType, 'notificationType must be string');
        this.Preconditions.shouldBeObject(notificationTemplate, 'notificationTemplate must be an object');

        if (!(notificationTemplate instanceof NotificationTemplate)) {
            let options = notificationTemplate;

            notificationTemplate = new NotificationTemplate(options);
        }

        this.mappings[notificationType] = notificationTemplate.name;
        this.templates[notificationTemplate.name] = notificationTemplate;

        return this;
    }

    builder() {
        let builder = new NotificationBuilder({
            url: this.url
        });

        if (this.payload) {
            builder.mergeIntoPayload(this.payload);
        }

        return builder;
    }

    notificationTemplate(notificationType) {
        let notificationTemplateName = this.mappings[notificationType];
        var notificationTemplate = this.templates[notificationTemplateName];

        this.Preconditions.shouldBeDefined(notificationTemplate, 'Notification template not found for ' + notificationType);

        return notificationTemplate;
    }

    /**
     *
     * @param {String} type
     * @param {*|undefined} data
     * @return {Promise}
     */
    notify(type, data) {
        this.Preconditions.shouldBeString(type, 'NotificationService.notify(type, data): type must be string.');
        //this.Preconditions.shouldBeDefined(data, 'NotificationService.notify(type, data): data must be defined.');
        data = data || {};

        let url = this.url;
        let scope = this;
        let Preconditions = this.Preconditions;

        let notificationTemplate = this.notificationTemplate(type);
        let builder = this.builder();
        let promise = notificationTemplate.render(builder, data);

        return promise
            .then((builder) => {
                // Let's sanity the builder before executing.

                Preconditions.shouldBeDefined(builder, 'No builder for ' + type);

                if (!builder.url) {
                    builder.url = url;
                }

                let payload = builder.payload;

                Preconditions.shouldBeString(builder.url, 'NotificationService.notify(): builder.url was undefined');
                // Attachments without top level text are valid.
                //Preconditions.shouldBeString(payload.text, 'builder did not complete \'text\' property. ' + JSON.stringify(payload));

                return builder.execute();
            });
    }
}

